mapper.select:

select 

from jvd_umagoto_race_joho
where KETTO_TOROKU_BANGO = #{kettoTorokuBango,jdbcType=CHAR}
  and RACE_CODE = #{raceCode,jdbcType=CHAR}
  and UMABAN = #{umaban,jdbcType=CHAR}

mapper.delete:

delete from jvd_umagoto_race_joho
where KETTO_TOROKU_BANGO = #{kettoTorokuBango,jdbcType=CHAR}
  and RACE_CODE = #{raceCode,jdbcType=CHAR}
  and UMABAN = #{umaban,jdbcType=CHAR}
